import React from 'react';
import PbxView from '../../components/pbxView/pbxView';
import FbxView from '../../components/fbxView/fbxView';
import CbxView from '../../components/cbxView/cbxView';
import classes from './GeneralPatientCockpit.module.css';

const generalPatientCockpit = (props) => {
return(

    <div>
        <header><button onClick = {() => props.mainRender()}>Back</button> Save Entry Button</header>
        <div className={classes.h3Field}>
            <div> <strong>Patient ID : </strong> {props.clientArr[0]} </div>
            <div> <strong> Therapy Session </strong> </div>
            <div> <label>Session Date:</label> <input type="text" placeholder="Example: 12/21/2020" onChange={(event) => props.dateChange(event)} value={props.date}/> </div>   
        </div>
        <PbxView
            clientArray = {props.clientArr}
            pbArray = {props.pbArr}
            inc = {(index) => props.increase(index)}
            red = {(index) => props.reduce(index)}
        />
        <div className={classes.FBandCB}>
            <div>
                <FbxView
                    clientArray ={props.clientArr}
                    fbArray = {props.fbArr}
                    func = {(event, index) => props.funcHandle(event, index)}
                />
            </div>
            <div>
                <CbxView
                    tableMaker = {props.tableMaker}
                    showChart = {props.showChart}
                    changeTable = {props.changeTable}
                    openModal = {props.openModal}
                    clientArray ={props.clientArr}
                    closeTable = {props.closeTable}
                />
            </div>
        </div>
    </div>
);
}

export default generalPatientCockpit
